import Task from "./Task";

export default function TasksCont() {
  return (
    <div className="tasks-container">
      <ul>
        <Task />
      </ul>
      <div className="controls">
        <span>items left</span>
        <ul>
          <li>All</li>
          <li>Active</li>
          <li>Completed</li>
        </ul>
        <button>Clear Completed</button>
      </div>
    </div>
  );
}
